-- ----------------------------
-- Table structure for sys_organization
-- ----------------------------
DROP TABLE IF EXISTS `sys_organization`;
CREATE TABLE `sys_organization`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `name` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '组织名称',
  `code` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '组织编码',
  `type` int(11) NOT NULL COMMENT '组织类型1代理商2企业',
  `robot` int(11) NULL DEFAULT 0 COMMENT '机器人数量',
  `start_date` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '机器人有效起始时间',
  `end_date` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '机器人有效截止时间',
  `line` int(11) NULL DEFAULT 0 COMMENT '线路数量',
  `del_flag` int(11) NOT NULL DEFAULT 0 COMMENT '删除标识0正常1删除',
  `open` int(11) NOT NULL COMMENT '0未开户1已开户',
  `create_id` bigint(20) NOT NULL,
  `create_time` datetime(0) NOT NULL,
  `update_id` bigint(20) NOT NULL,
  `update_time` datetime(0) NOT NULL,
  `sub_code` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '子编码',
  `botstence` int(11) NULL DEFAULT 0 COMMENT '话术数量',
  `usable` int(1) NOT NULL DEFAULT 0 COMMENT '可用状态：0-不可用；1-可用',
  `effective_date` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '授权起始时间',
  `invalid_date` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '授权失效时间',
  `bussiness_id` int(11) NULL DEFAULT NULL COMMENT '商务id',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_sys_organization_usable`(`usable`) USING BTREE,
  INDEX `idx_sys_organization_code`(`code`) USING BTREE,
  INDEX `idx_sys_organization_name`(`name`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 199 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

